bool ShaderDesc::IsShaderVersionSupported(ShaderVersion ver)
{
	switch (ver)
	{
	case ShaderVersion_D3D1xFL11X:
		return true;
	default:
		return false;
	}
};

ShaderDesc::ShaderType ShaderDesc::GetShaderTypeForComboIndex(unsigned comboIndex, ShaderVersion ver)
{
	switch (ver)
	{
	case ShaderDesc::ShaderVersion_D3D1xFL11X:
		{
			SF_UNUSED(comboIndex);
			SF_DEBUG_ASSERT(0, "D3D1xFL11X indicated that ShaderCombo information was not required.");
			return ST_None;
		}
	default:
		SF_DEBUG_ASSERT1(0, "Invalid shader platform provided (%d)", ver);
		return ST_None;
	}
};

