UPInt ShaderDesc::GetShaderUniformSize(ShaderStages stage)
{
	switch (stage)
	{
	case ShaderStage_Vertex:
		return Uniform::SU_VertexSize;
	case ShaderStage_Frag:
		return Uniform::SU_FragSize;
	case ShaderStage_Geometry:
		return Uniform::SU_GeometrySize;
	case ShaderStage_Hull:
		return Uniform::SU_HullSize;
	case ShaderStage_Domain:
		return Uniform::SU_DomainSize;
	case ShaderStage_Compute:
		return Uniform::SU_ComputeSize;
	default:
		SF_DEBUG_ASSERT1(0, "Unexpected shader stage (%d)\n", stage);
		return 0;
	}
}

